import React, { Component } from "react";
import Slider from "react-slick";
import styled from 'styled-components';
import { FC } from "react";
const image = "../../../public/media/images/workspace.jpg" 
const SliderElement = styled.div`
width: 560px;
height: 150px;
margin:20px;
background-color: white;
justify-content: center;
border-radius: 5%;
box-shadow:4px 4px 8px 1px #8e8e8e;
border-radius:5px;

`
const SliderBox=styled.div``;
const Margin = styled.div`
max-width:810px;
margin-left:65px;
`;
const Workspace = styled.img`

`;
export default class SuperSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 3,
    };
    return (
      <Margin>
      
        <Slider {...settings}>
        <SliderBox>
        <SliderElement>1
          </SliderElement>
          </SliderBox>
          <SliderElement>2
          </SliderElement>
          <SliderElement>3
          </SliderElement>
          <SliderElement>4
          </SliderElement>
          <SliderElement>5
          </SliderElement>
        </Slider>
      </Margin>
    );
  }
}
